import React from 'react';


const dataProductTable = () => {
    return {
        bookTitle: ['Buku 1', 'Buku 2', 'Buku 3', 'Buku 4', 'Buku 5'],
        stock: [1, 5, 32, 8, 45]
    }
}

export default dataProductTable;
